  });

export default function NavBar() {
    // const classes = useStyles();
    return (
        <ThemeProvider theme={theme}>
        <AppBar position='static'>
            <Toolbar >

                    <Button variant="contained" to={"/home"} component={Link}>
                        Home
                    </Button>
                    <Button variant="contained" to={"/addMovie"} component={Link}>
                        Add Movie
                    </Button>
                    <LoginStatus/>

            </Toolbar>
        </AppBar>
        </ThemeProvider>
    )
}
